import React from 'react';

class BlogPage extends React.Component {
    render() {
        return (
            <div>
                <h1>BLog Page</h1>
                <div className="post">
                    <h3>England defeats Iceland!</h3>

                    <p>
                        England finally came through after Sterling scored one goal at the very end!
                    </p>
                </div>
            </div>
        );
    }
}

export default BlogPage;
